package com.tuisitang.modules.shop.entity;import java.io.Serializable;import net.jeeshop.core.dao.page.PagerModel;/**     * @{#} Navigation.java   *  * Navigation Entity *  * <p>Copyright: Copyright(c) 2013 </p>  * <p>Company: TST</p> * @version 1.0 * @author <a href="mailto:paninxb@gmail.com">panin</a>    */public class Navigation extends PagerModel<Navigation> implements Serializable {	private static final long serialVersionUID = 1L;	protected Long id;	private String name;	private String target;	private String position;	private String description;	private int sort;	private String http;	public void clear() {		super.clear();		id = null;		name = null;		target = null;		position = null;		description = null;		sort = 0;		http = null;	}	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public String getTarget() {		return target;	}	public void setTarget(String target) {		this.target = target;	}	public String getPosition() {		return position;	}	public void setPosition(String position) {		this.position = position;	}	public String getDescription() {		return description;	}	public void setDescription(String description) {		this.description = description;	}	public int getSort() {		return sort;	}	public void setSort(int sort) {		this.sort = sort;	}	public String getHttp() {		return http;	}	public void setHttp(String http) {		this.http = http;	}}